import * as brain from 'brain.js';

const net = new brain.NeuralNetwork();

// Entraînez votre modèle ici
const trainingData = [
  { input: [0, 0], output: [0] },
  { input: [0, 1], output: [1] },
  { input: [1, 0], output: [1] },
  { input: [1, 1], output: [0] }
];

net.train(trainingData);

export default { net };
